// Estrutura de um no da memoria
typedef struct cel {
    int tipo;
    char status;
    struct cel *right;
    struct cel *left;
} celula;

typedef celula* no;

static celula* heap;
static int heapIndex = 0;

//Retorna um dos nos da heap
no criarno(int tipo) {
    if(heapIndex == H) {
        printf("Full Healp");
        return NULL;
    }
    heap[heapIndex].tipo = tipo;
    heap[heapIndex].left = heap[heapIndex].right = NULL;
    return &heap[heapIndex++];
}

