//Procedimento que recebe duas variaveis, uma que aponta para
//um array e outra que aponta para um inteiro com a posicao do
//array a ser usada. O procedimento termina quando atinge a
//primeira posicao depois dos parenteses.
void casaParenteses(char* string, int* p) {
    int paren = 1;
    int c = *p;
    while (paren != 0) {
        char x = string[c];
        if(x == '(') {
            paren++;
            c++;
        }
        else if(x == ')') {
            paren--;
            c++;
        }
        else {
            c++;
        }
    }
    *p = c;
}

//Recebe uma string e um inteiro que armazena
//a posicao do ( parenteses a ser deletado.
//Reescreve a string, sem o abre parenteses
//do inteiro e seu fecha parenteses correspondente.
void removeParenteses(char* string, int index) {
    int i = ++index;
    casaParenteses(string, &index);
    while(i < index-1){
        string[i-1] = string[i];
        i++;
    }
    for(i = index ; string[i] != '\0' ; i++) {
        string[i-2] = string[i];
    }
    string[i-2] = '\0';
}

//Serve para eliminar os parenteses duplos
void eliminaParentesesDuplos(char* string) {
    int i = 0, remove = 0;
    while(string[i] != '\0') {
        if(string[i] == '(' && string[i+1] == '(') remove = 1;
        if(remove == 1) {
            removeParenteses(string, i+1);
            remove = 0;
            i--;
        }
        i++;
    }
}

int converterInt(char caractere){
    switch(caractere){
        case 'K':
            return K;
            break;
        case 'S':
            return S;
            break;
        case 'I':
            return I;
            break;
        case 'B':
            return B;
            break;
        case 'C':
            return C;
            break;
        case 'D':
            return D;
            break;
        case 'E':
            return E;
            break;
        case 'F':
            return F;
            break;
        case 'Y':
            return Y;
            break;
        case '+':
            return ADICAO;
            break;
        case '-':
            return SUBTRACAO;
            break;
        case '/':
            return DIVISAO;
            break;
        case '*':
            return MULTIPLICACAO;
            break;
        case '<':
            return MENOR;
            break;
        case '>':
            return MAIOR;
            break;
        case '=':
            return IGUAL;
            break;
        default:
            return caractere - '0';
            break;
    }
}

//Recebe a String a ser convertida, o index de inicio
//da string, e o index de onde a string termina.
//Converte esta string para grafo e
//retorna o no raiz do grafo gerado
no geraGrafo(char* string, int indexAtual, int indexFinal) {
    no root = criarno(RAIZ);

    // nó esquerda
    int aux = converterInt(string[indexAtual++]);
    no combinador = criarno(aux);
    root->left = combinador;
    combinador->left = NULL;

    // nó direita
    while(indexAtual < indexFinal) {
        if(string[indexAtual] != '(') {
            int aux = converterInt(string[indexAtual++]);
            no combinador = criarno(aux);
            no arroba = criarno(ARROBA);
            arroba->right = combinador;
            arroba->left = root->left;
            root->left = arroba;
        }
        else {
            indexAtual++;
            int inicio = indexAtual;
            casaParenteses(string, &indexAtual);
            int fim = indexAtual-1;
            no subgrafo = geraGrafo(string, inicio, fim);
            no arroba = criarno(ARROBA); // esta linhs
            arroba->right = subgrafo->left;
            arroba->left = root->left;
            root->left = arroba;
        }
    }
    return root;
}

//Recebe a string a ser convertida em grafo
//e retorna o no raiz do grafo gerado
no constroiGrafo(char* string) {
    int lenght = 0;
    while(string[lenght] != '\0')
        lenght++;
    return geraGrafo(string, 0, lenght);
}

int tamanhoGrafo(no grafo) {
    int size = -1;
    no p = grafo;
    while(p != NULL) {
        size++;
        p = p->left;
    }
    return size;
}

// @->@->@->@->@->@->@->@->@->NULL
int buscaCombinador(no grafo) {
    no p = grafo;
    while(p->left != NULL)
        p = p->left;
    return p->tipo;
}

// K a b = a
void reduzK(no grafo) {
    int size = tamanhoGrafo(grafo);
    no p = grafo;
    while(size > 3) {
        p = p->left;
        size--;
    }
    p->left = p->left->left->right;
}

// S a b c = ac(bc)
void reduzS(no grafo) {
    int size = tamanhoGrafo(grafo);
    no p = grafo;
    while(size > 4) {
        p = p->left;
        size--;
    }
    no pai = criarno(ARROBA);
    no filhoEsq = criarno(ARROBA);
    no filhoDir = criarno(ARROBA);

    pai->left = filhoEsq;
    pai->right = filhoDir;

    filhoEsq->left = p->left->left->left->right; // a
    filhoEsq->right = p->left->right; // c

    filhoDir->left = p->left->left->right; // b
    filhoDir->right = p->left->right; // c

    p->left = pai;
}

