// Função eval
no eval (no valor){
    no subgrafo = criarno(RAIZ);
    subgrafo->left = valor;
    reduzGrafo(subgrafo);
    return subgrafo->left;
}

// + a b  => +(eval)(eval)
void reduzAdicao(no grafo) {
    int size = tamanhoGrafo(grafo);
    no p = grafo;
    while(size > 3) {
        p = p->left;
        size--;
    }
    no valorA = p->left->left->right;
    if(valorA->tipo == ARROBA)
        valorA = eval(valorA);

    no valorB = p->left->right;
    if (valorB->tipo == ARROBA)
        valorB = eval(valorB);

    no operacao = criarno(valorB->tipo + valorA->tipo);
    p->left = operacao;
}

// - a b  => -(eval)(eval)
void reduzSubtracao(no grafo) {
    int size = tamanhoGrafo(grafo);
    no p = grafo;
    while(size > 3) {
        p = p->left;
        size--;
    }
    no valorA = p->left->left->right;
    if(valorA->tipo == ARROBA)
        valorA = eval(valorA);

    no valorB = p->left->right;
    if (valorB->tipo == ARROBA)
        valorB = eval(valorB);

    no operacao = criarno(valorA->tipo - valorB->tipo);
    p->left = operacao;
}

// / a b  => /(eval)(eval)
void reduzDivisao(no grafo) {
    int size = tamanhoGrafo(grafo);
    no p = grafo;
    while(size > 3) {
        p = p->left;
        size--;
    }
    no valorA = p->left->left->right;
    if(valorA->tipo == ARROBA)
        valorA = eval(valorA);

    no valorB = p->left->right;
    if (valorB->tipo == ARROBA)
        valorB = eval(valorB);

    if (valorB->tipo == 0){
        printf("\nNão pode haver divisão por 0\n");
        exit(0);
    }
    no operacao = criarno(valorA->tipo / valorB->tipo);
    p->left = operacao;
}

// * a b  => *(eval)(eval)
void reduzMultiplicacao(no grafo) {
    int size = tamanhoGrafo(grafo);
    no p = grafo;
    while(size > 3) {
        p = p->left;
        size--;
    }
    no valorA = p->left->left->right;
    if(valorA->tipo == ARROBA)
        valorA = eval(valorA);

    no valorB = p->left->right;
    if (valorB->tipo == ARROBA)
        valorB = eval(valorB);

    no operacao = criarno(valorB->tipo * valorA->tipo);
    p->left = operacao;
}

